%DP_Benchmark_analysis
%run this separately so you don't have to repeat the calculations over and
%over in the Benchmark main program.


function [E_elec_opt_fine,P_elec_opt_fine,P_ICE_opt_fine,P_brake_opt_fine,fuel_consumed_L_opt,P_RTM_opt_fine,P_gen_opt_fine,P_BAS_opt_fine,process_time_fine_analysis,N_ICE_opt]=DP_Fine_Analysis(E_grid_size,Ts,regime,E_cost,E_state_target,E_step_min,E_elec_opt_coarse,P_RTM_fine,P_gen_fine,DP_SIM_DATA)


h = waitbar(0,'1','Name','Post-Processing Fine-search Cost-To-Go array...',...
            'CreateCancelBtn',...
            'setappdata(gcbf,''canceling'',1)');
setappdata(h,'canceling',0)

tStart=tic;

E_cost_rolledforward=zeros(2,E_grid_size,DP_SIM_DATA.CYCLE.T);
E_cost_rolledforward(1,:,DP_SIM_DATA.CYCLE.T)=0; %there is no cost to bring forward at k=T-1, only the one transition cost of the last step
E_cost_rolledforward(2,:,DP_SIM_DATA.CYCLE.T)=E_state_target; %desired final state is given by E_state_target

for k=(DP_SIM_DATA.CYCLE.T-1):-1:1
    E_cost_temp=full(E_cost{1,k}); %make a temporary copy, convert the sparse to a regular array
    E_cost_temp(E_cost_temp==0)=Inf;
    E_cost_temp(E_cost_temp==69)=0; %replace the substituted values
    for i=1:E_grid_size
        [min_value,min_index]=min(E_cost_temp(i,:)+E_cost_rolledforward(1,:,k+1)); %from the current state value, find the lowest cost transition to the next state.
        if k==(DP_SIM_DATA.CYCLE.T-1)&&(min_index~=101)
            E_cost_rolledforward(1,i,k)=Inf;
        else
            E_cost_rolledforward(1,i,k)=(E_cost_rolledforward(1,min_index,k+1))+min_value; %bring forward cost from the previous stage k+1, when starting at this state (that is now the ending state)
        end
        E_cost_rolledforward(1,i,k)=(E_cost_rolledforward(1,min_index,k+1))+min_value; %bring forward cost from the previous stage k+1, when starting at this state (that is now the ending state)
        E_cost_rolledforward(2,i,k)=min_index;
        
    end
    clear min_value %clear these variables
    clear min_index
    clear E_cost_temp
    waitbar((DP_SIM_DATA.CYCLE.T-k)/DP_SIM_DATA.CYCLE.T,h,sprintf('Processing Stage %d/%d',k,DP_SIM_DATA.CYCLE.T))
end %end k
delete(h)
close all

process_time_postprocessing_fine=toc(tStart);

