                end
                if P_gen_nearest_index_over<=0 %P_gen=0
                    N_ICE_opt(k)=0;
                    Treq_ICE_opt(k)=0;
                    fuel_power_in(k)=0;
                elseif (P_gen_nearest_index_under>0)&&(P_gen_nearest_index_under==P_gen_nearest_index_over)
                    N_ICE_opt(k)=P_Gen_opt_map(2,P_gen_nearest_index_under); %cell array version
                    Treq_ICE_opt(k)=P_Gen_opt_map(3,P_gen_nearest_index_under);
                    fuel_power_in(k)=P_Gen_opt_map(4,P_gen_nearest_index_under);
                elseif (P_gen_nearest_index_under==0) %lower index = 0
                    N_ICE_opt(k)=P_Gen_opt_map(2,P_gen_nearest_index_over);
                    Treq_ICE_opt(k)=P_Gen_opt_map(3,P_gen_nearest_index_over);
                    fuel_power_in(k)=P_Gen_opt_map(4,P_gen_nearest_index_over);
                elseif P_gen_nearest_index_over>800
                    N_ICE_opt(k)=P_Gen_opt_map(2,800);
                    Treq_ICE_opt(k)=P_Gen_opt_map(3,800);
                    fuel_power_in(k)=P_Gen_opt_map(4,800);
                else
                    N_ICE_opt(k)=interp1(P_Gen_opt_map(1,P_gen_nearest_index_under:P_gen_nearest_index_over),P_Gen_opt_map(2,P_gen_nearest_index_under:P_gen_nearest_index_over),P_gen_opt_fine(k));
                    Treq_ICE_opt(k)=interp1(P_Gen_opt_map(1,P_gen_nearest_index_under:P_gen_nearest_index_over),P_Gen_opt_map(3,P_gen_nearest_index_under:P_gen_nearest_index_over),P_gen_opt_fine(k));
                    fuel_power_in(k)=interp1(P_Gen_opt_map(1,P_gen_nearest_index_under:P_gen_nearest_index_over),P_Gen_opt_map(4,P_gen_nearest_index_under:P_gen_nearest_index_over),P_gen_opt_fine(k));
                end
                P_ICE_opt_fine(k)=N_ICE_opt(k)*(pi/30)*Treq_ICE_opt(k);
                P_BAS_opt_fine(k)=P_gen_opt_fine(k)*ge(P_gen_opt_fine(k),0);
            elseif DP_SIM_DATA.CYCLE.P_req(k)<0
                P_brake_opt_fine(k)=DP_SIM_DATA.CYCLE.P_req(k)-P_RTM_opt_fine(k);
                P_ICE_opt_fine(k)=0;
                P_BAS_opt_fine(k)=0;
                N_ICE_opt(k)=0;
                Treq_ICE_opt(k)=0;
                fuel_power_in(k)=0;
            end
            
        case 2 %parallel
            %P_RTM_opt_fine(k)=P_RTM_temp_k(E_grid_point_k,E_grid_point_kp1);
            if DP_SIM_DATA.CYCLE.P_req(k)>0
                P_ICE_opt_fine(k)=DP_SIM_DATA.CYCLE.P_req(k)-P_RTM_opt_fine(k);
                P_brake_opt_fine(k)=0;
            elseif DP_SIM_DATA.CYCLE.P_req(k)<0
                P_brake_opt_fine(k)=DP_SIM_DATA.CYCLE.P_req(k)-P_RTM_opt_fine(k);
                P_ICE_opt_fine(k)=0;
            else
                P_ICE_opt_fine(k)=0;
                P_brake_opt_fine(k)=0;
                P_RTM_opt_fine(k)=0;
                P_gen_opt_fine(k)=0;
            end
            P_BAS_opt_fine(k)=0;
            N_ICE_opt(k)=DP_SIM_DATA.CYCLE.ICE_rpm(k);
            Treq_ICE_opt(k)=P_ICE_opt_fine(k)/(N_ICE_opt(k)*(pi/30)+0.001);
            fuel_power_in(k)=ICE_costfunction([N_ICE_opt(k);Treq_ICE_opt(k)]);
        otherwise
            P_ICE_opt_fine(k)=0;
            P_brake_opt_fine(k)=0;
            P_BAS_opt_fine(k)=0;
            N_ICE_opt(k)=0;
            Treq_ICE_opt(k)=0;
            fuel_power_in(k)=0;
            
    end
    clear P_RTM_temp_k
    clear P_elec_temp_k
    %fuel_consumed_L_opt=fuel_consumed_L_opt+(fuel_power_in(k)*(1/(34.8e6)));old
    %method
    fuel_consumed_L_opt=fuel_consumed_L_opt+(fuel_power_in(k)*(Ts/(22554000)));
    
end

%final stage
k=DP_SIM_DATA.CYCLE.T;
E_grid_k=E_grid_kp1;
E_grid_point_k=E_grid_point_kp1; %the current value of grid point is the 'optimal' point found last iteration.
E_elec_opt_fine(k)=E_grid_k(E_grid_point_k); %record the actual energy state of the battery in the tracking array.
P_elec_opt_fine(k)=-1*(E_grid_point_kp1-E_grid_point_k)*(3600/Ts); %new power in W; negative indicates charging
P_RTM_opt_fine(k)=0;
P_gen_opt_fine(k)=0;

switch regime
    case 1 %series
        if DP_SIM_DATA.CYCLE.P_req(k)>0
            P_BAS_opt_fine(k)=P_gen_opt_fine(k)/BAS_Eff;
            P_ICE_opt_fine(k)=P_BAS_opt_fine(k)/BAS_belt_Eff;
            P_brake_opt_fine(k)=0;
            f=@(x)equality_constraint(x,P_ICE_opt_fine(k));
            [x,fval]=fmincon(@ICE_costfunction,x0,[],[],[],[],lb,ub,f,options);
            N_ICE_opt(k)=x(1);
            Treq_ICE_opt(k)=x(2);
            fuel_power_in(k)=fval;
        elseif DP_SIM_DATA.CYCLE.P_req(k)<0
            P_brake_opt_fine(k)=DP_SIM_DATA.CYCLE.P_req(k)-P_RTM_opt_fine(k);
            P_BAS_opt_fine(k)=P_gen_opt_fine(k)/BAS_Eff;
            P_ICE_opt_fine(k)=P_BAS_opt_fine(k)/BAS_belt_Eff;
            N_ICE_opt(k)=0;
            Treq_ICE_opt(k)=0;
            fuel_power_in(k)=0;
        else
            P_ICE_opt_fine(k)=0;
            P_brake_opt_fine(k)=0;
            P_BAS_opt_fine(k)=0;
            N_ICE_opt(k)=0;
            Treq_ICE_opt(k)=0;
            fuel_power_in(k)=0;
        end
    case 2 %parallel
        if DP_SIM_DATA.CYCLE.P_req(k)>0
            P_RTM_opt_fine(k)=P_RTM_temp_k(E_grid_point_k,E_grid_point_kp1);
            P_ICE_opt_fine(k)=DP_SIM_DATA.CYCLE.P_req(k)-P_RTM_opt_fine(k);
            P_brake_opt_fine(k)=0;
            N_ICE_opt(k)=ICE_rpm(k);
            Treq_ICE_opt(k)=P_ICE_opt_fine(k)/((N_ICE_opt(k)*(pi/30))+0.001);
            fuel_power_in(k)=ICE_costfunction([N_ICE_opt(k);Treq_ICE_opt(k)]);
        elseif DP_SIM_DATA.CYCLE.P_req(k)<0
            P_RTM_opt_fine(k)=P_RTM_temp_k(E_grid_point_k,E_grid_point_kp1);
            P_brake_opt_fine(k)=DP_SIM_DATA.CYCLE.P_req(k)-P_RTM_opt_fine(k);
            P_ICE_opt_fine(k)=0;
            Treq_ICE_opt(k)=0;
            fuel_power_in(k)=0;
        else
            P_ICE_opt_fine(k)=0;
            P_brake_opt_fine(k)=0;
            P_RTM_opt_fine(k)=0;
            P_gen_opt_fine(k)=0;
            Treq_ICE_opt(k)=0;
            fuel_power_in(k)=0;
        end
        P_BAS_opt_fine(k)=0;
    otherwise
        P_ICE_opt_fine(k)=0;
        P_brake_opt_fine(k)=0;
        P_BAS_opt_fine(k)=0;
        N_ICE_opt(k)=0;
        Treq_ICE_opt(k)=0;
        fuel_power_in(k)=0;
        
end
clear P_RTM_temp_k
clear P_elec_temp_k
%fuel_consumed_L_opt=fuel_consumed_L_opt+(fuel_power_in(k)*(1/(34.8e6)));
%%old method
fuel_consumed_L_opt=fuel_consumed_L_opt+(fuel_power_in(k)*(Ts/(22554000)));
process_time_fine_analysis=toc(tStart);

end



